package kube

import (
	"context"
	"github.com/stretchr/testify/assert"
	"testing"
)

func TestListDeployments(t *testing.T) {
	if testing.Short() {
		t.Skip()
	}
	conf := /*`apiVersion: v1
		clusters:
		- cluster:
		    certificate-authority-data: 
		    server: https://kubernetes.docker.internal:6443
		  name: docker-desktop
		contexts:
		- context:
		    cluster: docker-desktop
		    user: docker-desktop
		  name: docker-desktop
		current-context: docker-desktop
		kind: Config
		preferences: {}
		users:
		- name: docker-desktop
		  user:
		    client-certificate-data: 
		    client-key-data: `*/
		`apiVersion: v1
clusters:
- cluster:
    certificate-authority-data: 
    server: https://kubernetes.docker.internal:6443
  name: docker-desktop
contexts:
- context:
    cluster: docker-desktop
    user: docker-desktop
  name: docker-desktop
current-context: docker-desktop
kind: Config
preferences: {}
users:
- name: docker-desktop
  user:
    client-certificate-data: 
    client-key-data: `

	kubeClient, err := NewClient(&conf)
	assert.NoError(t, err)

	lst, err2 := kubeClient.GetDeployments(context.TODO(), "coding-cd", 1)
	assert.NoError(t, err2)

	assert.NotEmpty(t, lst)
}
